    this._messageValue = state || MessageType.Neutral;
  }

  get detailTypeClass(): string {
    return this._messageValue + this.DETAIL_STYLE_STRING;
  }

  get titleTypeClass(): string {
    return this._messageValue + this.TITLE_STYLE_STRING;
  }

}

